  (*f_S_Equ_BP_Node_Ptr) +=  -d_staticContributions[admsNodeID_S][admsProbeID_V_S_BP];
  (*f_S_Equ_D_Node_Ptr) +=  +d_staticContributions[admsNodeID_S][admsProbeID_V_D_BD] +d_staticContributions[admsNodeID_S][admsProbeID_V_D_S];
  (*f_S_Equ_GP_Node_Ptr) +=  +d_staticContributions[admsNodeID_S][admsProbeID_V_GP_S];
