  (*f_BI_Equ_BD_Node_Ptr) +=  +d_staticContributions[admsNodeID_BI][admsProbeID_V_BD_BI];
  (*f_B_Equ_B_Node_Ptr) +=  +d_staticContributions[admsNodeID_B][admsProbeID_V_B_BI];
  (*f_B_Equ_BI_Node_Ptr) +=  -d_staticContributions[admsNodeID_B][admsProbeID_V_B_BI];
  (*f_BI_Equ_B_Node_Ptr) +=  +d_staticContributions[admsNodeID_BI][admsProbeID_V_B_BI];
  (*f_NOI2_Equ_NOI2_Node_Ptr) +=  +d_staticContributions[admsNodeID_NOI2][admsProbeID_V_NOI2_GND];
  (*f_NOI2_Equ_S_Node_Ptr) +=  -d_staticContributions[admsNodeID_NOI2][admsProbeID_V_D_S] -d_staticContributions[admsNodeID_NOI2][admsProbeID_V_GP_S] +d_staticContributions[admsNodeID_NOI2][admsProbeID_V_S_BP];
  (*f_NOI2_Equ_BP_Node_Ptr) +=  -d_staticContributions[admsNodeID_NOI2][admsProbeID_V_S_BP];
  (*f_NOI2_Equ_GP_Node_Ptr) +=  +d_staticContributions[admsNodeID_NOI2][admsProbeID_V_GP_S];
  (*f_NOI2_Equ_D_Node_Ptr) +=  +d_staticContributions[admsNodeID_NOI2][admsProbeID_V_D_S];
  (*f_NOI_Equ_S_Node_Ptr) +=  -d_staticContributions[admsNodeID_NOI][admsProbeID_V_D_S] -d_staticContributions[admsNodeID_NOI][admsProbeID_V_GP_S] +d_staticContributions[admsNodeID_NOI][admsProbeID_V_S_BP];
  (*f_NOI_Equ_BP_Node_Ptr) +=  -d_staticContributions[admsNodeID_NOI][admsProbeID_V_S_BP];
  (*f_NOI_Equ_GP_Node_Ptr) +=  +d_staticContributions[admsNodeID_NOI][admsProbeID_V_GP_S];
  (*f_NOI_Equ_D_Node_Ptr) +=  +d_staticContributions[admsNodeID_NOI][admsProbeID_V_D_S];
  (*f_NOI_Equ_NOI2_Node_Ptr) +=  +d_staticContributions[admsNodeID_NOI][admsProbeID_V_NOI2_GND];
  (*f_NOI_Equ_NOI_Node_Ptr) +=  +d_staticContributions[admsNodeID_NOI][admsProbeID_V_NOI_GND];
  (*f_D_Equ_NOI2_Node_Ptr) +=  +d_staticContributions[admsNodeID_D][admsProbeID_V_NOI2_GND];
  (*f_S_Equ_NOI2_Node_Ptr) +=  +d_staticContributions[admsNodeID_S][admsProbeID_V_NOI2_GND];
  (*f_BS_Equ_BP_Node_Ptr) +=  -d_staticContributions[admsNodeID_BS][admsProbeID_V_S_BP];
  (*f_BS_Equ_GP_Node_Ptr) +=  +d_staticContributions[admsNodeID_BS][admsProbeID_V_GP_S];
  (*f_BD_Equ_BP_Node_Ptr) +=  -d_staticContributions[admsNodeID_BD][admsProbeID_V_S_BP];
  (*f_BD_Equ_GP_Node_Ptr) +=  +d_staticContributions[admsNodeID_BD][admsProbeID_V_GP_S];

#else
  //use the offsets instead of pointers
  dFdx[li_D][A_D_Equ_S_NodeOffset] +=  +d_staticContributions[admsNodeID_D][admsProbeID_V_S_BS] -d_staticContributions[admsNodeID_D][admsProbeID_V_GP_S] -d_staticContributions[admsNodeID_D][admsProbeID_V_D_S] +d_staticContributions[admsNodeID_D][admsProbeID_V_S_BP];
  dFdx[li_D][A_D_Equ_BP_NodeOffset] +=  -d_staticContributions[admsNodeID_D][admsProbeID_V_S_BP];
  dFdx[li_BP][A_BP_Equ_S_NodeOffset] +=  -d_staticContributions[admsNodeID_BP][admsProbeID_V_GP_S] -d_staticContributions[admsNodeID_BP][admsProbeID_V_D_S] +d_staticContributions[admsNodeID_BP][admsProbeID_V_S_BP];
  dFdx[li_BP][A_BP_Equ_BP_NodeOffset] +=  +d_staticContributions[admsNodeID_BP][admsProbeID_V_BP_BI] -d_staticContributions[admsNodeID_BP][admsProbeID_V_S_BP];
  dFdx[li_D][A_D_Equ_D_NodeOffset] +=  +d_staticContributions[admsNodeID_D][admsProbeID_V_D_BD] +d_staticContributions[admsNodeID_D][admsProbeID_V_D_S];
  dFdx[li_BP][A_BP_Equ_D_NodeOffset] +=  +d_staticContributions[admsNodeID_BP][admsProbeID_V_D_S];
  dFdx[li_D][A_D_Equ_GP_NodeOffset] +=  +d_staticContributions[admsNodeID_D][admsProbeID_V_GP_S];
  dFdx[li_BP][A_BP_Equ_GP_NodeOffset] +=  +d_staticContributions[admsNodeID_BP][admsProbeID_V_GP_S];
  dFdx[li_S][A_S_Equ_S_NodeOffset] +=  +d_staticContributions[admsNodeID_S][admsProbeID_V_S_BS] -d_staticContributions[admsNodeID_S][admsProbeID_V_GP_S] -d_staticContributions[admsNodeID_S][admsProbeID_V_D_S] +d_staticContributions[admsNodeID_S][admsProbeID_V_S_BP];
  dFdx[li_S][A_S_Equ_BP_NodeOffset] +=  -d_staticContributions[admsNodeID_S][admsProbeID_V_S_BP];
  dFdx[li_S][A_S_Equ_D_NodeOffset] +=  +d_staticContributions[admsNodeID_S][admsProbeID_V_D_BD] +d_staticContributions[admsNodeID_S][admsProbeID_V_D_S];
